import React from 'react';

const RazredRow = ({ id, razred, idNastavnikRazrednik }) => {
  return (
    <div>
      <p>idRazred: {id}</p>
      <p>razred: {razred}</p>
      <p>idNastavnikRazrednik: {idNastavnikRazrednik}</p>
    </div>
  );
};

export default RazredRow;
